import React, { Component } from 'react'
import { Button, Form, Grid, Header, Image, Loader, Dimmer, Segment, Message, Table } from 'semantic-ui-react';
import 'semantic-ui-css/semantic.min.css';
import axios from 'axios';
import { getEnterpriseById } from "../../../Store/actions/EnterpriseAction";
import { connect } from 'react-redux';
import Profile from "../Profile/Profile";
import "../../Public.css"
class EnterpCards extends Component {
    state = {
        loading: false,
        myCards: []
    }
    componentDidMount() {

    }
    render() {
        console.log(this.props.enterprise)
        return (
            <div>
                <Profile Name={this.props.enterprise.Name}></Profile>
                <h1 style={{ fontSize: '20px', textAlign: "center", color: '#00b5ad' }}>| My Card/s |</h1>
                <Grid>
                    <Grid.Column width={8}>
                        <Segment attached='top'>
                            The button below accepts clicks with mouse and key presses with
                            Space Bar or Enter.
          </Segment>
                        <Button
                            attached='bottom'
                            content='Click'
                            onClick={this.handleClick}
                            onKeyPress={this.handleKeyPress}
                        />
                    </Grid.Column>
                    <Grid.Column width={8}>
                        <Segment>
                            <pre style={{ height: 100, overflowY: 'scroll' }}>
                                {log.map((e, i) => (
                                    <p key={i}>{e}</p>
                                ))}
                            </pre>
                        </Segment>
                    </Grid.Column>
                </Grid>
            </div>
        )
    }
}
const mapStateToProps = state => {
    return {
        enterprise: state.enterprise.enterprise,
    }
}
const mapDispatchToProps = dispatch => {
    return {
        selectEnterprise: (id) => dispatch(getEnterpriseById(id)),
    }
}
export default connect(mapStateToProps, mapDispatchToProps)(EnterpCards);
